import React, {useEffect} from 'react';
import "../../../styles/Partials/_navBar.scss";
import Pikmin from "../../../assets/pikmin.gif"


export default function NavBar() {
  useEffect(()=>{
    document.documentElement.style.setProperty('--animation-duration',`${Math.random()*10+5}s`)
  },[])
  return (
    <div>
        <nav>
            <ul>
                <li><a className="homelink" href="#home">Hanson</a></li>
                <li><a href="#about">About</a></li>
                <li><a href="#projects">Projects</a></li>
                <li><a className="connectlink" href="#contact">Connect</a></li>
            </ul>
        </nav> 
        <img className='pikimin' src={Pikmin}></img>
    </div>
  );

}
